import logo from './logo.svg';
import './App.css';
import {useEffect, useState} from "react";


function App() {
    const [message, setMessage] = useStat();
    useEffect(()=> {
        fetch("/")
            .then((res)=>{
                alert(res.text())
                return res.json();
            })
            .then((data)=>{
                setMessage(data);
            })
            .catch(e => {
                alert("error")
            })
    },[]);


    return (
        <div className="App">
            {message}
        </div>
    );
}

export default App;
